text:
Things Trump’s cabinet secretaries have looked up:⁣
@SocialSecurity Administrator: “What is Social Security?”⁣⁣
@Sec_Noem: “What is Habeas Corpus?”⁣⁣
@FEMA Administrator: “What is hurricane season?”⁣⁣

Forget hiring the best. He can’t even hire people who know the basics.

Millions of families are struggling to put food on the table, yet Republicans want to cut $230 billion from food programs for the poor. ⁣
⁣
@chefjoseandres said we cannot forget about our neighbors in need and I couldn't agree more –– I’ll fight to protect food stamp programs.
